import React, { useState } from 'react';
import axios from 'axios';
import './PlayerStats.css';

const PlayerStats = () => {
  const [playerStats, setPlayerStats] = useState([]);

  const fetchPlayerStats = async () => {
    try {
      const response = await axios.get('http://127.0.0.1:5000/player-stats');
      console.log('Response:', response.data);  // Log the response data
      if (Array.isArray(response.data)) {
        setPlayerStats(response.data);
      } else {
        console.error('Expected an array but got:', response.data);
      }
    } catch (error) {
      console.error('Error fetching player stats:', error);
    }
  };

  return (
    <div>
      <button onClick={fetchPlayerStats}>Fetch Player Stats</button>
      <div>
        {Array.isArray(playerStats) && playerStats.length > 0 ? (
          <table>
            <thead>
              <tr>
                {Object.keys(playerStats[0]).map((key) => (
                  <th key={key}>{key}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {playerStats.map((row, index) => (
                <tr key={index}>
                  {Object.values(row).map((value, i) => (
                    <td key={i}>{value}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No player stats available.</p>
        )}
      </div>
    </div>
  );
};

export default PlayerStats;
